description:
डोल्पाको काइगाउँमा शुक्रबारदेखि जारी भारी हिमपातका कारण जनजीवन प्रभावित भएको छ ।&amp;nbsp;

शुक्रबार रातिदेखि निरन्तर हिमपात भइरहेकाले यातायातका साधन ठप्प भएका छन् भने बाहिर आवतजावत गर्नसमेत कठिनाइ भएको छ ।

लगातार परेको हिमपातका कारण स्थानीय बासिन्द

नेपाली कम्युनिस्ट पार्टीले नेता हरिबोल गजुरेलसहित सात नेतालाई कारबाही गरेको छ।

आगामी प्रतिनिधि सभा निर्वाचनमा पार्टीको निर्देशनविपरीत बागी उम्मेदवारी दिएको भन्दै नेकपाले गजुरेलसहित सात नेतालाई कारबाही गरेको हो ।&amp;nbsp;

कारबाही पर्नेमा महेश्वर दा
